import React, { useState } from 'react';
import { View, Text, StatusBar, TextInput, TouchableOpacity, StyleSheet, Picker } from 'react-native';
import { getAuth } from 'firebase/auth';
import { getFirestore, doc, updateDoc } from 'firebase/firestore';
import { firebaseApp } from '../firebase/credenciales';
import { initializeApp } from 'firebase/app';
import { firebaseConfig } from '../firebase/credenciales';

const EditarInformacion = ({ navigation }) => {
  const [carrera, setCarrera] = useState('');
  const [grado, setGrado] = useState('');
  const [numeroControl, setNumeroControl] = useState('');
  const [turno, setTurno] = useState('');
  const firebaseApp = initializeApp(firebaseConfig);
  const auth = getAuth(firebaseApp);
  const currentUser = auth.currentUser;

  const handleUpdate = async () => {
    try {
      const db = getFirestore();
      const userRef = doc(db, 'usuarios', currentUser.uid);

      await updateDoc(userRef, {
        carrera: carrera,
        numeroControl: numeroControl,
        grado: grado,
        turno: turno,
      });

      navigation.navigate('Mi Perfil');
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <View style={styles.container}>
      <StatusBar backgroundColor="#007AFF" />
      <Text style={styles.title}>Editar Información</Text>
      <View style={styles.inputContainer}>
        <Text style={styles.label}>Carrera</Text>
        <Picker
          style={styles.picker}
          selectedValue={carrera}
          onValueChange={(value) => setCarrera(value)}
        >
          <Picker.Item label="Ingeniería en Tics" value="Ingeniería en Tics" />
          <Picker.Item label="Ingeniería Mecanica" value="Ingeniería Mecanica" />
          <Picker.Item label="Ingeniería Química" value="Ingeniería Química" />
          <Picker.Item label="Ingeniería Industrial" value="Ingeniería Industrial" />
          <Picker.Item label="Ingeniería Electrónica" value="Ingeniería Electrónica" />
          <Picker.Item label="Ingeniería Eléctrica" value="Ingeniería Eléctrica" />
          <Picker.Item label="Ingeniería Gestión Empresarial" value="Ingeniería Química" />
        </Picker>
      </View>
      <View style={styles.inputContainer}>
        <Text style={styles.label}>Numero de control</Text>
        <TextInput
          style={styles.input}
          placeholder="Ingresa tu numero de control"
          onChangeText={(text) => setNumeroControl(text)}
        value={numeroControl}
        />
      </View>
      <View style={styles.inputContainer}>
        <Text style={styles.label}>Semestre</Text>
        <TextInput
          style={styles.input}
          placeholder="Ingresa tu nuevo semestre"
          onChangeText={(text) => setGrado(text)}
        value={grado}
        />
      </View>
      <View style={styles.inputContainer}>
        <Text style={styles.label}>Turno</Text>
        <TextInput
        style={styles.input}
        placeholder="Ingrese su turno"
        onChangeText={(text) => setTurno(text)}
        value={turno}
        />
      </View>
      <TouchableOpacity style={styles.button} onPress={handleUpdate}>
        <Text style={styles.buttonText}>Guardar</Text>
      </TouchableOpacity>

      <TouchableOpacity style={styles.button} 
      onPress={() => navigation.goBack()}>
        <Text style={styles.buttonText}>Regresar</Text>
      </TouchableOpacity>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#FFFFFF',
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
    textAlign: 'center',
    marginTop: 20,
    marginBottom: 20,
  },
  inputContainer: {
    marginHorizontal: 20,
    marginTop: 10,
  },
  label: {
    fontSize: 16,
    marginBottom: 5,
    color: '#333333',
  },
  input: {
    height: 40,
    borderWidth: 1,
    borderRadius: 5,
    borderColor: '#CCCCCC',
    paddingLeft: 10,
  },
  button: {
    backgroundColor: '#007AFF',
    marginHorizontal: 20,
    marginTop: 20,
    height: 50,
    borderRadius: 5,
    justifyContent: 'center',
    alignItems: 'center',
  },
  buttonText: {
    color: '#FFFFFF',
    fontWeight: 'bold',
    fontSize: 16,
  },
});

export default EditarInformacion;
